import React from "react";
import { Link } from "react-router-dom";
import Styles from "./NavBar.module.scss";

const NavBar = (props) => {

    const navMenu = {
        reports: {
            title: "Reports",
            payload: [
                <Link to="/Sales"/>
        ]
        }
    }

    return (
        <div className={Styles.wrapper}>
            <Link to="/">Inventory</Link>
            <Link to="/">Reports</Link>
        </div>
    );
}

export default NavBar;
